import { useState, useEffect } from "react";

export default function Chats(props) {
  // fetch a list of the people in a course
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("./classSpecificPeople.json")
      .then((res) => res.json())
      .then((data) => {
        setData(data.people); //change the state and re-render
      });
  }, []);

  let studentNames = data.map((student) => {
    return (
      <div className="col-9">
        <div className="card">
          <div className="card-body">
            <h5 className="card-title">{student.person}</h5>
          </div>
        </div>
      </div>
    );
  });

  return (
    <div>{studentNames}</div>
  );
}
